import axios from 'axios';

const handelSortenUrl = () => {
    const url = 'https://www.insightmetricsbd.com/';

    axios.post('http://localhost:4000/generateSortenUrl', url).then(res => console.log(res));
}

const UrlSorten = () => {
    return (
        <div class="container">
            <div><h1 className="page-title">URL Sorten</h1></div>

        </div>
    )
}

export default UrlSorten
